		String description5 = "<h4 style=\"color: rgb(204, 102, 0);background-color: rgb(255, 255, 255);\">Deine Story in Die Sims 4!</h4><p style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Die Sims 4 ist das mit Spannung erwartete Lebenssimulationsspiel, in dem du wie nie zuvor Schicksal spielen kannst. Erlebe ein neues Maß an Kreativität, wenn du mit dem leistungsstarken <b>Erstelle einen Sim</b> deine Sims formst und mit dem taktilen, modulbasierten Bau-Modus wunderschöne Häuser kreierst. Betrachte und teile neue Spielinhalte in der Galerie und füge sie deinem Spiel hinzu. Steuere Körper, Herz und Geist deiner Sims und erforsche deine neuen Spielmöglichkeiten in pulsierenden Nachbarschaften, in denen deine Geschichten zum Leben erweckt werden.</p><div class=\"rightImage\" style=\"text-align: center;float: right;color: rgb(51, 51, 51);width: 320px;background-color: rgb(255, 255, 255);\"><a href=\"https://images-eu.ssl-images-amazon.com/images/P/B00KPY3KV2.01.PT05.LXXXXXXX.jpg\" style=\"color: rgb(153, 102, 51);\"><img src=\"https://images-eu.ssl-images-amazon.com/images/P/B00KPY3KV2.01.PT05._SX300_SCLZZZZZZZ_.jpg\" width=\"300\" height=\"168\" alt=\"Screenshot: Die Sims 4\"/></a><div class=\"imageCaption\">Erschaffe und steuere Sims mit individuellem Aussehen, einzigartiger Persönlichkeit und neuen Emotionen.</div></div><h5 style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Intelligentere Sims</h5><p style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Erschaffe intelligentere Sims mit einzigartigem Aussehen, Charakter und Emotionen in Die Sims 4. Erstelle einzigartige Sims und gestalte ihr Aussehen, ihren Kleidungsstil, ihre Persönlichkeitsmerkmale, ihre Fähigkeiten, ihre Karrieren und ihre Gangart nach deiner Vorstellung. Zum ersten Mal sind Sims in der Lage, Emotionen zu empfinden und auszudrücken. Deine Sims erleben eine Reihe von Gefühlsregungen, die durch ihre Interaktionen, andere Sims, Events und Objekte beeinflusst werden. Emotionen erweitern deine Auswahl und eröffnen dir neue Spielmomente mit noch mehr Möglichkeiten. Hab Spaß, wenn deine Sims interagieren und ihre eigene Persönlichkeit bei sozialen Kontakten zum Ausdruck bringen.</p><p style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\"><br/></p><h4 style=\"color: rgb(204, 102, 0);background-color: rgb(255, 255, 255);\">Spiele Schicksal</h4><p style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Du hast die Kontrolle über die bedeutenden und unterhaltsamen Momente im Leben deiner Sims. Hilf ihnen dabei, ihre Karriere zu verfolgen, Freunde zu finden und Beziehungen aufzubauen. Erkunde die Möglichkeiten. Wie wirst du in Die Sims 4 Schicksal spielen?</p><h5 style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Neue Emotionen</h5><div class=\"rightImage\" style=\"text-align: center;float: right;color: rgb(51, 51, 51);width: 320px;background-color: rgb(255, 255, 255);\"><a href=\"https://images-eu.ssl-images-amazon.com/images/P/B00KPY3KV2.01.PT04.LXXXXXXX.jpg\" style=\"color: rgb(153, 102, 51);\"><img src=\"https://images-eu.ssl-images-amazon.com/images/P/B00KPY3KV2.01.PT04._SX300_SCLZZZZZZZ_.jpg\" width=\"300\" height=\"168\" alt=\"Screenshot: Die Sims 4\"/></a><div class=\"imageCaption\">Der Bau-Modus gibt dir die Möglichkeit, die Häuser deiner Sims auf intuitive Weise zu gestalten.</div></div><p style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Deine Entscheidungen beeinflussen die Gefühle deiner Sims im Spiel. Wie werden sie auf Schicksalsmomente reagieren – und was wirst du in Die Sims 4 mit ihnen anstellen?</p><h5 style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Bedeutungsvolle Möglichkeiten</h5><p style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Emotionen eröffnen dir neue Wahlmöglichkeiten, die deine Sims beeinflussen und ihre Geschichten in Die Sims 4 formen. Deine Entscheidungen schalten potenzielle neue Interaktionen und Erfahrungen frei, mit denen du einzigartige Geschichten für deine Sims entwickeln kannst.</p><h5 style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Voller Leben</h5><p style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Beeinflusse, wie deine Sims denken, sich bewegen und fühlen. Die von dir kreierten Sims stecken voller Leben, und ihre Schicksalsmomente in Die Sims 4 werden dich überraschen und begeistern.</p>";
